import React from "react"
import {navData} from "../router/index"
import {NavLink} from "react-router-dom"
function Nav(){
    return(
        navData.map((item,index)=>{
            <NavLink
                to={item.path}
                key={index}
            >{item.title}</NavLink>
        })
    )
}

export default Nav;
